import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function SubmitFeedback() {
  const navigate = useNavigate();
  const [mentorName, setMentorName] = useState("");
  const [week, setWeek] = useState("");
  const [queries, setQueries] = useState("");
  const [openQueries, setOpenQueries] = useState("");
  const [description, setDescription] = useState("");
  const [rating, setRating] = useState(1);
  const [user, setUser] = useState("");

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) navigate("/UserLogin");

    const payload = JSON.parse(atob(token.split(".")[1]));
    const username =
      payload["http://schemas.microsoft.com/ws/2008/06/identity/claims/name"];
    setUser(username);
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem("token"); 
    if (!token) {
      alert("You must be logged in to submit feedback.");
      return;
    }

    const feedbackData = {
      mentorName, week, queries, openQueries, description, rating: Number(rating)
    };

    try {
      const res = await fetch("https://localhost:7079/api/Feedback/submit-feedback", {
        method: "POST",
        headers: { "Content-Type": "application/json", "Authorization": `Bearer ${token}` },
        body: JSON.stringify(feedbackData),
      });

      const text = await res.text();
      if (!res.ok) throw new Error(text || "Failed to submit feedback");

      alert("Feedback submitted successfully!");
      setMentorName(""); setWeek(""); setQueries(""); setOpenQueries(""); setDescription(""); setRating(1);

    } catch (err) {
      console.error("Submit error:", err);
      alert("Error submitting feedback. Check console.");
    }
  };

  return (
    <div className="min-h-screen bg-blue-50 font-sans">
      {/* Header */}
      <header className="flex justify-between items-center bg-white px-6 py-4 shadow-md rounded-b-md">
        <h2 className="text-blue-900 text-lg font-semibold">Welcome, {user}</h2>
        <button
          onClick={handleLogout}
          className="px-4 py-2 bg-red-400 hover:bg-red-600 text-white rounded-md text-sm font-medium transition"
        >
          Logout
        </button>
      </header>

      {/* Form container */}
      <div className="max-w-md mx-auto mt-2 p-6 bg-blue-50 rounded-xl shadow-lg">
        <h2 className="text-center text-blue-900 text-xl font-semibold mb-4">
          Freshers 2025 - AppDev - Feedback survey about your Mentor
        </h2>

        <form className="flex flex-col gap-4" onSubmit={handleSubmit}>
          <label className="text-blue-900 font-medium">Your Mentor full name</label>
          <input
            type="text"
            value={mentorName}
            onChange={(e) => setMentorName(e.target.value)}
            required
            className="px-3 py-2 border border-blue-200 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-300"
          />

          <label className="text-blue-900 font-medium">Choose the Week you are providing review for</label>
          <select
            value={week}
            onChange={(e) => setWeek(e.target.value)}
            required
            className="px-3 py-2 border border-blue-200 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-300"
          >
            <option value="">Select Week</option>
            {Array.from({ length: 12 }, (_, i) => (
              <option key={i} value={`Week ${i + 1}`}>Week {i + 1}</option>
            ))}
          </select>

          <label className="text-blue-900 font-medium">Did your mentor answer all your questions this week?</label>
          <select
            value={queries}
            onChange={(e) => setQueries(e.target.value)}
            required
            className="px-3 py-2 border border-blue-200 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-300"
          >
            <option value="">-- Select --</option>
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>

          <label className="text-blue-900 font-medium">If you have open queries, describe them</label>
          <input
            type="text"
            value={openQueries}
            onChange={(e) => setOpenQueries(e.target.value)}
            placeholder="Type NA if no open queries"
            className="px-3 py-2 border border-blue-200 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-300"
          />

          <label className="text-blue-900 font-medium">How many lines of code did you write this week?</label>
          <input
            type="text"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            className="px-3 py-2 border border-blue-200 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-300"
          />

          <label className="text-blue-900 font-medium">Overall rating for your mentor</label>
          <select
            value={rating}
            onChange={(e) => setRating(e.target.value)}
            className="px-3 py-2 border border-blue-200 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-300"
          >
            <option value={1}>⭐</option>
            <option value={2}>⭐⭐</option>
            <option value={3}>⭐⭐⭐</option>
            <option value={4}>⭐⭐⭐⭐</option>
            <option value={5}>⭐⭐⭐⭐⭐</option>
          </select>

          <button
            type="submit"
            className="mt-2 py-2 bg-blue-400 hover:bg-blue-700 text-white font-semibold rounded-md transition"
          >
            Submit Feedback
          </button>
        </form>
      </div>
    </div>
  );
}
